// SPDX-License-Identifier: MIT
pragma solidity ^0.8.16;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract TokenBalanceTracker is Ownable {
    address[] public erc20Tokens;
    address[] public erc721Tokens;

    constructor(address[] memory _erc20Tokens, address[] memory _erc721Tokens) {
        erc20Tokens = _erc20Tokens;
        erc721Tokens = _erc721Tokens;
    }

    function addERC20Token(address tokenAddress) public onlyOwner {
        erc20Tokens.push(tokenAddress);
    }

    function addERC721Token(address tokenAddress) public onlyOwner {
        erc721Tokens.push(tokenAddress);
    }

    function getERC20Balance() public view returns (uint256[] memory) {
        uint256[] memory erc20Balances = new uint256[](erc20Tokens.length);
        for (uint256 i = 0; i < erc20Tokens.length; i++) {
            uint256 balance = IERC20(erc20Tokens[i]).balanceOf(msg.sender);
            erc20Balances[i] = balance / (10 ** 18);
        }
        return erc20Balances;
    }

    function getERC721Balance() public view returns (uint256[] memory) {
        uint256[] memory erc721Balances = new uint256[](erc721Tokens.length);
        for (uint256 i = 0; i < erc721Tokens.length; i++) {
            uint256 balance = IERC721(erc721Tokens[i]).balanceOf(msg.sender);
            erc721Balances[i] = balance;
        }
        return erc721Balances;
    }

    function getERC20array() public view returns (address[] memory) {
        return erc20Tokens;
    }

    function getERC721array() public view returns (address[] memory) {
        return erc721Tokens;
    }
}
